					// }else if(msg.text === "Abriendo Fuerza de Ventas" || msg.text ===  "1.- PARAD, 2.- PURJ01, 3.- AGCOMUNIC, 4.- IDEAL, 5.- DIGSHOP")
					// {
					// 	document.getElementById("analytics").src ="https://demo-presalesmexico.us1.sapbusinessobjects.cloud/sap/fpa/ui/tenants/presalesmexico/bo/story/955672D950DF6308DF64A3CCBDE9BE55?mode=embed&page=2";
				
					// }else if(msg.text === "Abriendo Planes")
